import '../css/styleM.scss';
import Navigation from '../component/Navigation';
import TokenListing from './component/TokenListing';
import TempTokenListing from './component/TempTokenListing';
import ServiceBackground from './images/service-background.png'
import { useMediaQuery } from 'react-responsive';
import TokenContext from '../../../contexts/TokenContext';
import { useContext } from 'react';

const Service = () => {
  const { tokenlist } = useContext(TokenContext);

  return (
    <div className="elysia--mobile">
      <div className={`service`}>
        <section className="main" style={{ backgroundImage: `url(${ServiceBackground})` }}>
          <Navigation />
          <div className="main__title-wrapper">
            <h1 className="main__title-text">The Liquidity Protocol</h1>
            <h1 className="main__title-text--blue">COMING SOON</h1>
            <p className="main__subtitle-text">ELYFI is an open source and non-custodial liquidity protocol for earning<br />interest on deposits and borrowing assets.</p>
          </div>
        </section>
        <section className="tokens">
          <TempTokenListing
            header={"Asset Token Listing"}
          />
        </section>
      </div>
    </div>
  );
}

export default Service;
